const axios = require('axios');

export const authorizeInstagram = () => {
  return axios.get(`/`)
  .then((response) => {
    console.log(response)
    return response.data;
  })
}

export const searchInstagram = (query) => {
  return axios.get(`/search/${query}`)
  .then((response) => {
    console.log(response);
    return response.data;
  })
}
